--
-- Trigger `bayar_hutang`
--
DELIMITER $$
CREATE TRIGGER `log_bayarhutang` BEFORE INSERT ON `bayar_hutang` FOR EACH ROW BEGIN

DECLARE vUser varchar(50);

SELECT iduser FROM bayar_hutang bh JOIN hutang h ON bh.hutang_id = h.id WHERE hutang_id = NEW.hutang_id INTO vUser;


INSERT INTO log_aktivitas(iduser, judul, kategori, tanggal) 
VALUES(vUser, 'Anda Membayar Hutang','Hutang',now());

END
$$
DELIMITER ;

